import React from 'react';
import './Header.css';

const header = () => {
    return (
        <div className='Header'>
            <div className='bx--row'>
                <div>
                    <header>
                        <h1>Kirana Product Billing</h1>
                    </header>
                </div>
            </div>
        </div>
    )
}

export default header;
